def isSubsequence2(s, t):
	'''
	WHY AM I RUNNING DP????
	'''
	nRow = len(s) + 1
	nCol = len(t) + 1
	memo = []
	memo = [0 for j in range(nCol)]
	
	for i in range(1, nRow):
		current = memo[:]
		if s[i - 1] not in t:
			return False
		for j in range(1, nCol):
			if t[j - 1] == s[i - 1]:
				current[j] = memo[j - 1] + 1
			else:
				current[j] = max(current[j - 1], memo[j])
		memo = current
	#print memo
	return len(s) == memo[nCol - 1]
	
def isSubsequence(s, t):
	i = 0
	j = 0
	while j < len(t):
		if i < len(s) and s[i] == t[j]:
			i += 1
		j += 1
	return i == len(s)
	
